import React from "react";

const resumes = [
    { id: 1, name: "Resume 1", pdfUrl: "resume1.pdf" },
    { id: 2, name: "Resume 2", pdfUrl: "resume2.pdf" },
    // Add more resumes with their PDF URLs
  ];

  
const ResumeGrid = ({ resumes }) => {
  const handleResumeClick = (pdfUrl) => {
    window.open(pdfUrl, "_blank");
  };

  return (
    <div className="resume-grid">
      {resumes.map((resume) => (
        <div
          key={resume.id}
          className="resume-item"
          onClick={() => handleResumeClick(resume.pdfUrl)}
        >
          <h3>{resume.name}</h3>
          <img src={`resume${resume.id}.jpg`} alt={resume.name} />
        </div>
      ))}
    </div>
  );
};

export default ResumeGrid;
